import React, { useEffect } from 'react'
import './Cart.css'
import axios from '../../Constants/axios'

function Cart() {
    useEffect(() => {
        axios.get('shop/get-cart-items/false').then((response) => {
            let data = response.data
            console.log(data);
        })
    })
  return (
    <div>Cart</div>
  )
}

export default Cart
